INSERT INTO `criterioevaluacion` VALUES ('7', '1', '1.	 El docente demuestra conocimiento sobre la problemática del módulo  (identifica nuevos problemas, integra nuevos datos, información y requerimientos).', '0', '1', '2014-03-20 05:39:45', '2014-03-20 15:56:41');
